function OOb(a){var b;DOb.call(this,a);b=new byb;oyb(b.b,'<div id="help">\r\n\r\n\r\n    <p>\r\n        spotmouth will allow you to view the information that others have thought was important about where you are at.\r\n    <\/p>\r\n\r\n    <p>\r\n        spotmouth is just a fun idea that a Pittsburgh native had.\r\n    <\/p>\r\n\r\n    <p>\r\n        spotmouth allows folks to easily get interesting information based upon where they are and where their interests\r\n        are. It also does this while respecting privacy. You won\'t see posts on facebook of what you are doing.\r\n    <\/p>\r\n\r\n    <p>\r\n        spotmouth does this by obtaining an address (from your mobile device or by you typing it in). It will perform a\r\n        search based upon your location and display nearby marks. In addition to viewing the marks that others have\r\n        left,\r\n        you are only 4 clicks from leaving your own mark. Choose "MENU" at the top, choose the "Leave Mark" button and\r\n        choose your spot, then leave your mark!\r\n    <\/p>\r\n\r\n    <p>\r\n        Spotmouth allows user to "mark" spots with images, videos, audio files and text. Spotmouth uses your location to\r\n        determine what spots to show you.\r\n    <\/p>\r\n\r\n    <p>\r\n        spots are places (like color me mine), or license plates (as on cars), or just where you happen to be (in the\r\n        woods,or on a river)\r\n    <\/p>\r\n\r\n    <p>\r\n        Each spot can have one or more "groups". For example, there could be "Schenley High School" which would be a\r\n        spot,\r\n        and for this spot there could be a bunch of groups such as "Chess Club", "Swim Team" Anybody can create a group\r\n        at\r\n        any spot. The person who creates the group can control how the group is run. For example, the group can be\r\n        public\r\n        and anyone can join, or it can require approval to join. One users are part of a group, any messages sent to the\r\n        group will be sent to that person. Messages are sent via email, SMS messaging, the spotmouth website, or the\r\n        spotmouth mobile applications.\r\n    <\/p>\r\n\r\n    <p>\r\n        You can choose to leave a mark on any of these different types of things by either going to the spot detail\r\n        page, or\r\n        by going to the menu.\r\n    <\/p>\r\n\r\n    <p>\r\n        Another feature of spotmouth is the ability to send messages to your friends and family. When you signin, you\r\n        will\r\n        be able to create groups to hold your different types of friends and send them messages. For example, you can\r\n        create\r\n        a "best friends", or "work friends" groups.\r\n    <\/p>\r\n\r\n    <p>\r\n        As a spotowner, you can use spotmouth to describe your business, hours, address, create coupons, and events and\r\n        much\r\n        more.\r\n    <\/p>\r\n\r\n\r\n<\/div>\r\n\r\n',true);Txb(b);SHb(this,b)}

his is not how to change\n        your password.\n    <\/p>\n\n    <p>\n        Clean settings will delete the username and password and any other settings that are stored as part of\n        spotmouth.\n\n    <\/p>\n\n<\/div>\n'};_=vmc.prototype=umc.prototype=new H;_.gC=function wmc(){return Tab};_.wf=function xmc(){return '<h2>Spot Detail<\/h2>\n\n<div id="help">\n\n    <p>\n        Mark Spot, this will take you to a form where you can leave a mark on this spot.\n\n    <\/p>\n\n    <p>\n        Groups, this will take you to all the groups for this spot. From there, you can join a group.\n\n    <\/p>\n\n    <p>\n        View Map, view this spot on a map.\n\n    <\/p>\n\n<\/div>\n'};_=zmc.prototype=ymc.prototype=new H;_.gC=function Amc(){return Uab};_.wf=function Bmc(){return '<h2>Contact<\/h2>\n\n<div id="help">\n    <p>\n        A secret key is kind of like a password. If you put in a the correct secret key, you would be able to unlock the\n        item that was uses this secret key.\n\n    <\/p>\n\n<\/div>\n'};_=Dmc.prototype=Cmc.prototype=new H;_.gC=function Emc(){return Vab};_.wf=function Fmc(){return '<h2>Favorites<\/h2>\n\n<div id="help">\n    <p>\n        This screen displays all the spots you have chosen to follow.\n    <\/p>\n\n\n    <p>\n        If you want to add something to your favorites, just visit the spot page of your favorite, and click the "Follow\n        spot" button. You will need to be logged in to spotmouth to\n        do this.\n\n    <\/p>\n\n    <p>\n        When you follow a spot, anytime something happens with the spot such as a new mark for the spot, you will be\n        notified. Use this to keep in touch with your favorite spots!\n\n    <\/p>\n\n<\/div>\n\n'};_=Hmc.prototype=Gmc.prototype=new H;_.gC=function Imc(){return Wab};_.wf=function Jmc(){return '<h2>Group<\/h2>\n\n<div id="help">\n    <p>\n        Name: Give your group a distinctive name.\n    <\/p>\n\n    <p>\n        Description: Give your group a description.\n    <\/p>\n\n    <p>\n        Group Code: You can provide a "Group Code" for you group. Group codes are kind of like a password. Anyone that\n        has the group code can become a member of the group. For example, you can tell members of your team to use group\n        code "team1", and\n        members of your team can join the group.\n    <\/p>\n\n    <p>\n        Group Code Prompt: On the group code entry form, where users would enter the group code, we display this text\n        here.\n    <\/p>\n\n    <p>\n        Visible to members: If this is set to true, all members of the group would be able to see other members of the\n        group.\n    <\/p>\n\n    <p>\n        Manage by members: If this is set to true, all members of the group can manage the group.\n    <\/p>\n\n    <p>\n        Open enrollment. If this is set to true, anybody can join the group.\n    <\/p>\n\n    <p>\n        Use the "Manage Members" to add and remove members of your group.\n    <\/p>\n\n\n    <p>\n        If you select a member, and click "member details", you can make that member an administrator of your group.\n    <\/p>\n\n\n<\/div>'};_=Lmc.prototype=Kmc.prototype=new H;_.gC=function Mmc(){return Xab};_.wf=function Nmc(){return '<h2>spotmouth Help<\/h2>\n\n\n<div id="help">\n    <p>\n        If you have questions, or need help, please use the "Contact" function in the menu. We will get right back to\n        you\n        with an answer\n    <\/p>\n\n\n    <h1>Home Menu<\/h1>\n\n    <p>This will take you to the spotmouth "Home" screen.<\/p>\n\n    <h1>Menu<\/h1>\n\n    <p>This will take you to the application menu screen<\/p>\n\n    <h1>Search<\/h1>\n\n    <p>This simple search at the top of every screen allows you to perform a keyword search of what is around\n        you.\n    <\/p>\n\n    <h1>Login<\/h1>\n\n    <p>\n        Login Form. From here, you can register for an account. Instead of registering, you can just login using your\n        facebook account by clicking the "Login by Facebook" button. Doing this will open a popup screen from facebook.\n        Once you authenticate, you will be logged into spotmouth.\n        If you forget your password, use the "Reset Password" feature to reset your password.\n    <\/p>\n\n    <h1>Mark Spot<\/h1>\n\n    <p>This will take you to a screen where you have to choose what type of spot you want to leave your mark\n        upon. There are places such as restaurants, license plates, or just where you are (not a place or license\n        plate).\n    <\/p>\n\n    <h1>Mark Place<\/h1>\n\n    <p>First thing that happens is we try to find a spot close to you to mark. If the spot you want is in\n        the list, just click it. If the spot you want isn\'t listed, you can add it by hitting the "My Spot is not listed\n        here." link where you can provide the details.\n    <\/p>\n\n    <h1>Leave Mark<\/h1>\n\n    <p>This form will allow you to upload files of any type along with some text for your mark.\n        As you upload the files, if they are images, you can see a thumbnail of the image.\n        You can also check if something is a Best Place or Worse Place here. This will cause the spot to be rated.\n        This allows folks to find the best or worse spots easily.\n\n    <\/p>\n\n    <h1>Spot Detail<\/h1>\n\n    <p>Displays name, address, hours, description, photos of the spot. Also coupons and events,and a\n        listing of the marks for the selected spot.\n    <\/p>\n\n    <h1>Mark Detail<\/h1>\n\n    <p>This will have some information about the spot that the mark belongs to, along with any photos and\n        text that belong to the mark.\n    <\/p>\n\n    <h1>Place Form<\/h1>\n\n    <p>You can get this screen from any "Spot Detail" screen when you choose the "Make Changes" button.\n        This screen allows you to manage the standard\n        spot details such as name, address, contact email, description, images, website link.\n        In addition to this, you can also create Events and Coupons here, create your own CMS-Driven website.\n    <\/p>\n\n    <h1>Secret key<\/h1>\n\n    <p>Use this field to set a secret key. More help on the secret key on available on the Leave Mark help\n        screen.\n    <\/p>\n\n    <h1>Search<\/h1>\n\n    <p>This screen allows you to perform a keyword search of spotmouth. By default, the search is constrained\n        by your location.\n        If you uncheck the "Filter by distance", your search will search 55 million and counting places.\n    <\/p>\n\n    <h1>Manage Profile<\/h1>\n\n    <p>Manage Profile: You can change your password and manage your profile picture here.\n    <\/p>\n\n    <h1>Manage Friends<\/h1>\n\n    <p>Create your friends here. When you add a friend, and they confirm you as a friend, you can send\n        them messages using spotmouth. Messaging via spotmouth is a cheap and power alternative to email and SMS. Your\n        friends\n        can be instantly notified (just like SMS) on their smart phones, and you can group your friends together into\n        groups. By putting your friends into groups, you can\n        send a message to a group (i.e. chess club) that you are headed over for pizza now, and each member of your\n        group will be notified.\n\n    <\/p>\n\n    <h1>Manage Groups<\/h1>\n\n    <p>Create your groups here. When you create a group, you can make it meet your needs in some cool\n        ways, such as making it a "Open Group", anyone can join, or a group\n        that if someone provides a password, they automatically become a member.\n        You can use these features to create groups that are self building and managing. For example, if you wanted to\n        manage your Club, you could create a group and allow anyone that wants to\n        join your club join this group. Anyone who is a member of the group can communicate with each other.\n\n\n    <\/p>\n\n    <h1>Messaging<\/h1>\n\n    <p>Your standard "Inbox", "Outbox" and where you compose messages to your friends and groups.<\/p>\n\n    <h1>Notifications<\/h1>\n\n    <p>Notifications will display any notifications that you have. Anytime a message is received or a mark is left in\n        your immediate vicinity, a notification is sent.\n    <\/p>\n\n    <h1>Favorites<\/h1>\n\n    <p>Favorites- This is the list of spots that you have choose to follow. You can remove items from your favorite\n        list here. If you want to add to your favorities, just go to your\n        favorite spots screen and click the Follow button.\n    <\/p>\n\n    <h1>Best Places<\/h1>\n\n    <p>These are spots that are rated as a "Best Place" that are close to your location<\/p>\n\n    <h1>Worse Places<\/h1>\n\n    <p>Worse Places. These are spots that are rated as a "Worse Place" that are close to your location<\/p>\n\n    <h1>Worse Drivers<\/h1>\n\n    <p>Worse Drivers, these are rated as the worse drivers on the Mark Spot screen<\/p>\n\n    <h1>Cutest Drivers<\/h1>\n\n    <p>Cutest Drivers, these are rated as the cutest drivers on the Mark Spot screen<\/p>\n\n    <h1>Dining<\/h1>\n\n    <p>Dining, things close to you that are "Dining"<\/p>\n\n    <h1>Lodging<\/h1>\n\n    <p>Lodging, things close to you that are lodging<\/p>\n\n    <h1>Drinking<\/h1>\n\n    <p>Drinking, things close to you that are Bars<\/p>\n\n    <h1>Fun<\/h1>\n\n    <p>Fun, things close to you that are Activities<\/p>\n\n\n    <h1>Location from device<\/h1>\n\n    <p>Sets your location based upon the GPS in your mobile device<\/p>\n\n    <h1>Secret Key<\/h1>\n\n    <p>Use this form with a secret key to find a hidden mark<\/p>\n\n    <h1>Settings<\/h1>\n\n    <p>Use this form to store your account on the device you are running spotmouth on.<\/p>\n\n    <h1>Contact Spotmouth<\/h1>\n\n    <p>hey! How about saying hello to us?<\/p>\n\n\n<\/div>\n\n\n\n\n\n\n'};_=Pmc.prototype=Omc.prototype=new H;_.gC=function Qmc(){return Yab};_.wf=function Rmc(){return '<h2>Mark Spot<\/h2>\n\n<div id="help">\n\n\n    <p>\n        Secret Key: If you prov
